import { useSelector } from "react-redux";
import Card from "../../components/Card/Card";

const Favorites = () => {
    const myFavorites = useSelector((state)=> state.myFavorites);

    return(
        <div>
            {myFavorites.map((card) => {
                return <Card
                id={card.id}
                name={card.name}
                status={card.status}
                species={card.species}
                gender={card.gender}
                origin={card.origin}
                image={card.image}
                />
            })}
        </div>
    )
}

export default Favorites;
